    "inputText": "Permian Gastroenterology Associates LLP\n315 E 5th Street, Odessa, TX 79761\nRavikumar P. Vemuru, M.D.\nSyam Vemulapalli, M.D.\nBoard certified in Gastroenterology and Internal medicine.\nPATIENT NAME:  XXX, XXX\t\t\t\t\t\t        MRNO:\nDATE OF BIRTH:  XXX\nDATE OF VISIT:  XXX\nREFERRING PHYSICIAN:  Dr. Suresh Prasad.\nCHIEF COMPLAINT:  Colon cancer screening.\nHISTORY OF PRESENT ILLNESS:  The patient is a 75-year-old female who is being evaluated for routine colon cancer screening.  The patient denies any abdominal pain.  No history of any bleeding.  No history of any change in bowel habits and no history of any weight loss.  No history of prior colonoscopy.\nPAST MEDICAL HISTORY:\nCoronary artery disease.\nSOCIAL HISTORY:  The patient denies any alcohol or smoking.\nFAMILY HISTORY:  Negative for any GI malignancies.\nCURRENT MEDICATIONS:  Include:\nDarvocet.\nLotrel.\nPlavix.\nNaprosyn.\nMetoprolol.\nFosamax.\nMEDICATION ALLERGIES:\nThe patient is allergic to PENICILLIN.\nREVIEW OF SYSTEMS:\nGENERAL:  Denies any unusual weakness, fatigue, or fever.\nSKIN:  Positive for occasional itching.  No rashes or skin lesions.\nHEENT:  Positive for decreased hearing.  Head:  Negative for history of head injury, headache, or dizziness.\nEYES:  No recent change in vision.  Denies blurring of vision or diplopia.\nEARS:  Negative for tinnitus, vertigo, or earaches.\nNOSE:  Negative for hay fever, nasal discharge, and nasal stuffiness.\nTHROAT:  Negative for sore throat or hoarseness.\n?\nXXX\t\t\t\t\t\t\t\t\t\t\t   PAGE TWO\nXXX\nNECK:  No swollen glands, lumps, pain, or stiffness.\nRESPIRATORY:  Negative for cough, sputum production, hemoptysis, or shortness of breath.\nCARDIOVASCULAR:  No dyspnea, orthopnea, chest pain, or palpitations.\nGASTROINTESTINAL:  Appetite is good.  Negative for dysphagia, odynophagia, nausea, vomiting, indigestion, diarrhea, or constipation.  No abdominal pain.  Bowel movements are regular.  No hematochezia or melena.\nGENITOURINARY:  No frequency, dysuria, hematuria, or urinary incontinence.\nPERIPHERAL VASCULAR:  No history of phlebitis or leg pain.  Negative for intermittent claudication.\nMUSCULOSKELETAL:  Denies arthralgia, injury, or swelling.  Denies any muscle stiffness, arthritis, gout, backache, or limitation of motion or activity.\nNEUROLOGICAL:  No fainting, seizures, motor, or sensory loss.  Long-term and short-term memory is intact.  Denies frequent headaches, weakness of the extremities, or slurring of the speech.\nPSYCHIATRIC:  No history of depression or treatment for psychiatric disorders.\nPHYSICAL EXAMINATION:\nVital signs:  Blood pressure:  118/73 mmHg.  Pulse:  96.  Temperature:  97.1.\nGeneral:  The patient is in no acute distress.  Alert, awake, and comfortable.\nHEENT:  Head:  Normocephalic and atraumatic.  Hair of average textures.  Scalp without lesions.\nSkin:  No infections, jaundice, rash, or petechiae.\nEyes:  Conjunctiva moist and pink.  PERRLA.\nEars:  Auditory, acuity good to whispered voice.\nNose:  Mucosa is pink.  No sinus tenderness.  No nasal discharge.\nMouth:  Oral mucosa is moist and pink.  No gingivitis.\nNeck:  Supple.  Trachea is midline.  No thyromegaly.  No lymphadenopathy.  Carotid, no bruits.\nHeart:  S1 and S2 regular.  No S3 or S4.  No murmurs.  No jugular vein distention.\nThorax:  Symmetric with good excursion.\nLungs:  Clear.  No rales, wheezing, or rhonchi.\nAbdomen:  Soft, nontender, and non-distended.  No masses.  No costovertebral angle tenderness.  Bowel sounds are active.\nPeripheral vascular:  Negative for ankle edema.  No stasis, pigmentation, or ulcers.  Radial pulses are 2+.  Dorsalis pedis 2+.\nMusculoskeletal:  No joint deformities.  Good range of motion.\nASSESSMENT:\nColon cancer screening.\n?\nXXX\t\t\t\t\t\t\t\t\t\t          PAGE THREE\nXXX\nPLAN:\nThe patient was advised and instructed regarding the risks and benefits of colonoscopy.  The patient agreed and consented for the procedure.\nShe was advised to stop Plavix four to five days, if okay with her cardiologist.\nFurther recommendations will be made based on the colonoscopic findings.\nThank you Dr. Prasad for allowing us to participate in the care of this patient.\n____________________\nSyam Vemulapalli, M.D.\nRje/hma\ncc:\tDr. Suresh Prasad\nPhone: 432 333 3433\t\t\t\tFax: 432 333 3450\t\t\t\tEmail : Raviv @ aol.com\n",
